-- ----------------------------
-- Table structure for `who_esoloo_supplier`
-- ----------------------------
DROP TABLE IF EXISTS `who_esoloo_supplier`;
CREATE TABLE `who_esoloo_supplier` (
  `supp_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动增加ID',
  `code` varchar(15) NOT NULL COMMENT '编号',
  `supp_name` varchar(500) DEFAULT NULL COMMENT '供应商名字',
  `gz_name` varchar(50) DEFAULT NULL COMMENT '供应商档口号',
  `supp_address1` varchar(50) DEFAULT NULL COMMENT '供应商地址1',
  `supp_address2` varchar(50) DEFAULT NULL COMMENT '供应商地址2',
  `address` varchar(500) DEFAULT NULL COMMENT '供应商地址',
  `contract_p` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `webaddress` varchar(500) DEFAULT NULL COMMENT '供应商网址',
  `telephone` varchar(500) DEFAULT NULL COMMENT '电话',
  `supp_qq` varchar(500) DEFAULT NULL COMMENT 'qq',
  `great_time` int(11) DEFAULT NULL COMMENT '添加时间',
  `last_time` int(11) DEFAULT NULL COMMENT '最后一次登录时间',
  `money` decimal(20,2) DEFAULT NULL COMMENT 'money',
  `bank_Info` varchar(500) DEFAULT NULL COMMENT '银行信息',
  `bank_number` varchar(500) DEFAULT NULL COMMENT '银行账号',
  `bank_number1` varchar(500) DEFAULT NULL COMMENT '银行账号1',
  `bank_remark` varchar(255) DEFAULT NULL COMMENT '银行备注',
  `intro` varchar(500) DEFAULT NULL COMMENT '介绍',
  `is_hide` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否隐藏   0：不隐藏；1：隐藏',
  `price_rate` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '汇率',
  `month_capacity` decimal(10,2) DEFAULT '0.00' COMMENT '月产能',
  `new_cycle` varchar(10) DEFAULT '0' COMMENT '上新周期',
  `admin_id` int(11) DEFAULT '0' COMMENT '采购员id',
  `cancel_reason` tinyint(3) DEFAULT NULL COMMENT '取消合作原因',
  `supp_discount` varchar(50) DEFAULT '' COMMENT '采购折扣(采购价)',
  `credit_rank` tinyint(3) DEFAULT '0' COMMENT '信用等级',
  `order_platform` varchar(20) DEFAULT '0' COMMENT '1:淘宝,2:天猫,3:独立平台,4:线下采购单,5:1688,6:代拍链接,0:其他',
  `delivery_cycle` int(10) DEFAULT NULL COMMENT '交货周期',
  `returned_date` int(10) DEFAULT NULL COMMENT '退货期限',
  `is_deposit` tinyint(1) DEFAULT '0' COMMENT '是否有保证金(0,否,1是)',
  `deposit` decimal(10,2) DEFAULT '0.00' COMMENT '保证金金额',
  `deposit_returned` tinyint(3) DEFAULT NULL COMMENT '是否已退保证金额（0,否,1是）',
  `cooperate_remark` varchar(500) DEFAULT '' COMMENT '合作备注',
  `settlement_type` tinyint(3) DEFAULT '0' COMMENT '结算方式：0：现结；1：周结；2：月结； 3：预付款；4：半月结；5：1.5月结；6：2月结；7：3月结；8：周结现拍',
  `settlement_date` int(10) DEFAULT NULL COMMENT '结算日期周结为星期几,月结为日期',
  `province` varchar(16) DEFAULT '' COMMENT '供应商省',
  `city` varchar(16) DEFAULT '' COMMENT '供应商市',
  `bd_admin_id` int(11) DEFAULT '0' COMMENT '商务拓展人员',
  `area` tinyint(2) DEFAULT '0' COMMENT '0:空  	1:长三角 2:珠三角    默认 0',
  `is_system` tinyint(2) NOT NULL DEFAULT '0' COMMENT '采购是否在供应商系统中处理,1是,0否',
  `shipping_type` tinyint(2) DEFAULT '0' COMMENT '运费方式：1顺丰到付，2包邮，3现付 4跨越到付',
  `oos_delay_time` int(11) NOT NULL DEFAULT '48' COMMENT '缺货超时时间(h)',
  `check_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0未选择、1免检、2抽检、3全检',
  `buyer_admin_id` int(11) DEFAULT '0' COMMENT '运营角色ID',
  `pur_demand_push_time` int(11) NOT NULL DEFAULT '0' COMMENT '采购需求推送时间',
  `order_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '采购类型:0-按需采购,1-备货采购',
  `is_pop` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否为POP商家:0-否,1-是',
  `company_name` varchar(200) NOT NULL DEFAULT '' COMMENT '公司名称',
  `is_barcode_print` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否打印条码:0-否,1-是',
  `main_cat_id` int(11) DEFAULT '0' COMMENT '主营分类id',
  `supplier_genre` tinyint(2) DEFAULT '1' COMMENT '供应商类型：1 供应商一  2 供应商二',
  `supplier_nature` tinyint(2) NOT NULL DEFAULT '0' COMMENT '供应商性质 1、自有工厂 2、经销商 3、OEM贴牌 必填项;',
  `is_real_time_push_pur_demand` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否实时推送采购需求:0-否,1-是',
  `realtime_push_start` varchar(10) NOT NULL DEFAULT '08:01' COMMENT '采购需求实施推送的开始时间',
  `realtime_push_end` varchar(10) NOT NULL DEFAULT '22:01' COMMENT '采购需求实施推送的结束时间',
  `rebate_remark` varchar(256) DEFAULT '' COMMENT '返点信息',
  `quality_control_id` int(11) DEFAULT '0' COMMENT '品控',
  `is_support_new_goods_stock_up` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否开通新品备货:0-否,1-是',
  `is_has_supp_stock_up_config` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否存在供应商备货信息配置',
  `currency` varchar(20) NOT NULL DEFAULT 'RMB' COMMENT '供应商采购币种',
  `supplier_aptitude` tinyint(2) NOT NULL DEFAULT '0' COMMENT '供应商资质1、公司 2、个体户 3、个人 必填项',
  `corporate_entity_id` int(11) NOT NULL DEFAULT '0' COMMENT '公司主体ID,who_company_info.rec_id',
  `pre_cancel` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否预取消 0：否；1：是',
  `return_type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '退货类型 1：拒退商家；2：协商商家；3：退货商家；4：寄售商家',
  `is_special_stock` tinyint(2) NOT NULL DEFAULT '0' COMMENT '0普通卖库存供应商，1新卖库存供应商',
  `corporate_juridical_person` varchar(50) DEFAULT '' COMMENT '公司法人',
  `wholesale_oos_delay_time` int(11) NOT NULL DEFAULT '0' COMMENT '缺货超时时间(h)/批发',
  `operation_admin_id` int(4) DEFAULT '0' COMMENT '运营角色',
  `language` tinyint(4) NOT NULL DEFAULT '10' COMMENT '语种:0.EN 1.AR 2.ES 3.FR 4.IT 5.JA 6.PL 10.CN',
  `is_key_Account` tinyint(2) DEFAULT '0' COMMENT '是否重点客户',
  `is_uniform_packing` tinyint(2) DEFAULT '0' COMMENT '是否统一包材 0：否 1：是',
  PRIMARY KEY (`supp_id`),
  KEY `idx_code` (`code`(3))
) ENGINE=InnoDB AUTO_INCREMENT=725 DEFAULT CHARSET=utf8 COMMENT='供应商信息表';

-- ----------------------------
-- Records of who_esoloo_supplier
-- ----------------------------

-- ----------------------------
-- Table structure for `who_rbac_user`
