DROP TABLE IF EXISTS `who_rbac_user`;
CREATE TABLE `who_rbac_user` (
  `user_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id(主键)',
  `user_name` varchar(60) NOT NULL DEFAULT '' COMMENT '后台登录用户名',
  `email` varchar(60) NOT NULL DEFAULT '' COMMENT '后台登录用户邮件地址',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '后台登录用户密码',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加用户时间',
  `last_login` int(11) NOT NULL DEFAULT '0' COMMENT '最后登录时间',
  `last_ip` varchar(15) NOT NULL DEFAULT '' COMMENT '最后登录IP',
  `nav_list` text NOT NULL COMMENT '用户快捷菜单',
  `is_deleted` tinyint(1) NOT NULL COMMENT '是否删除用户 0 未删 1 删除',
  `filiale_id` int(11) NOT NULL DEFAULT '-1' COMMENT '分公司id',
  `is_supp_user` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否供应商用户0 否，1是',
  `supp_code` varchar(16) NOT NULL DEFAULT '' COMMENT '供应商编号',
  PRIMARY KEY (`user_id`),
  KEY `user_name` (`user_name`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=31019 DEFAULT CHARSET=utf8 COMMENT='后台登录用户表';

